import React from 'react';
import { ContentBlockProps } from '../types';
import { MiddleBlockContainer, ContentWrapper } from './styles';

interface MiddleBlockProps extends ContentBlockProps {
  title?: string;
  content?: string;
  button?: string;
  img?: string;
  t: any;
}

const MiddleBlock: React.FC<MiddleBlockProps> = ({
  title,
  content,
  button,
  img,
  t,
}) => {
  return (
    <MiddleBlockContainer>
      <ContentWrapper>
        {/* Render the title, content, and button */}
      </ContentWrapper>
    </MiddleBlockContainer>
  );
};

export default MiddleBlock;
